        this.form_onload = function(obj,e)
        {
        	this.gfnFormOnload(obj);

        	var date = this.gfnGetDate();
        	this.divSearch.form.calMonth.set_value(date);

        	this.divSearch.form.cboType.set_index(0);
        	this.staTitle01.set_text(date.substr(0,4) + "년도 영업일 기준 월별 목표 대비 실적 현황");
        };

        //조회
        this.cfnSearch = function ()
        {
        	var selDate = this.divSearch.form.calMonth.value;
        	var selYear = selDate.substr(0,4);
        	this.dsParam1.setColumn(0, "YEAR", selYear);

        	this.fnTranSearch();
        };


        //max size 변경
        this.form_onsize = function(obj,e)
        {

        };
        /*******************************************************************************************************************************
         * 공통함수영역 (cfnSearch : 조회 / cfnSave : 저장 / cfnAdd : 신규 / cfnDel : 삭제 / cfnPrint : 인쇄..)
        *******************************************************************************************************************************/

        /*******************************************************************************************************************************
         * Transaction 서비스호출 처리 영역
        *******************************************************************************************************************************/
        this.fnTranSearch = function()
        {
        	var index = this.divSearch.form.cboType.index;
        	var strKeystring = index == 0 ? "G:+ORD+DEPT_CD" : "G:+ORD+DEPT_CD+EMP_NO";

        	this.dsOutput.set_keystring(strKeystring);

        	this.gfnInitNextGlobalDataset(this.dsGlobal);

        	this.dsParam1.applyChange();

        	// https://nextcns.tobesoft.com/FrontControllerServlet.do?service=xupservice&domain=NEXTp&model=MI_TargetVsResults_S01&format=xml&version=xplatform&compress=false HTTP/1.1
        	var strSvcId 	= "month";
        	var strSvcUrl 	= "nextService.do";
        	var inData 		= "dsGlobal=dsGlobal:A dsParam=dsParam1:A";
        	var outData 	= "dsOutput=dsOutput";
        	var strArg 		= "trxUrl=" + nexacro.wrapQuote("FrontControllerServlet.do?service=xupservice&domain=NEXTp&model=MI_TargetVsResults_S01&format=xml&version=xplatform&compress=false");

        	this.gfnTransaction(strSvcId, strSvcUrl, inData, outData, strArg, "fnCallback");

        };

        /*******************************************************************************************************************************
         * Callback 영역 (Transaction, popup, message..)
        *******************************************************************************************************************************/
        //transaction
        this.fnCallback = function (sSvcId, nErrCd, sErrMsg, oJson)
        {
        	switch(sSvcId) {
        		case "month":
        			break;
        		default:
        			break;
        	}
        };

